import React from "react";
import { Ionicons } from "@expo/vector-icons";

export default function TabIcon({ iconName, color }) {
	return (
		<Ionicons
			name={focused ? iconName : `${iconName}-outline`}
			color={color}
			size={22}
		/>
	);
}
